import { movies } from "./data/movies"
import MovieBox from "./components/movieBox";

function App() {
  return (
    <div>
      <h1>영화 목록</h1>
      <ul>
        {movies.results.map(movie => (
          <li key={movie.id}>
            <MovieBox
            title={movie.title}
            />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
